import React from 'react';
import s from './Categories.module.css'
import Category from "./Category/Category";
import {BrowserRouter, Router, Routes, Route, Switch} from "react-router-dom";

import archtect from './architect.svg';
import auto from './auto.svg';
import household from './household.svg'

const Categories = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={'Недвижимость'} imgPath={archtect} urlCategory={'nedvijimost'} className={s.categories}/>
            <Category nameCategory={'Транспорт'} imgPath={auto} urlCategory={'transport'} className={s.categories}/>
            <Category nameCategory={'Все для дома'} imgPath={household} urlCategory={'all_for_home'} className={s.categories}/>
          </div>
        </div>
      </div>
  );
};

export default Categories;
